import React, { useState } from 'react'
import './Addemployee.css'
import Sidebar from './Sidebar'
import Buttons from './Buttons'
import axios, { all } from 'axios'
import { useLocation } from 'react-router-dom';
function AddAdmin() {
  const location = useLocation();
  const { data1, data2 } = location.state;
  // function setData() {
  //   setName(data1);
  //   setOfficeEmail(data2);
  // }
  // the form value 
  const [userId, setUserId] = useState('');
  const [adminId, setAdminId] = useState('');
  const [name, setName] = useState('');
  const [fatherName, setFathersName] = useState('');
  const [department, setDepartment] = useState('');
  const [designation, setDesignation] = useState('');
  const [profile, setprofile] = useState(null);
  const [dob, setDob] = useState('');
  const [gender, setGender] = useState('');
  const [qualification, setQualification] = useState('');
  const [contactNumber, setContactNumber] = useState('');
  const [WhatsappNumber, setWhatsappNumber] = useState('');
  const [alternateNumber, setAlternateNumber] = useState('');
  const [officeEmail, setOfficeEmail] = useState('');
  const [personalEmail, setPersonalEmail] = useState('');
  const [marital, setMarital] = useState('');
  const [blood, setBlood] = useState('');
  const [pAdddres, setPAddress] = useState('');
  const [pCity, setPCity] = useState('');
  const [pState, setPState] = useState('');
  const [pPincode, setPPincode] = useState('');
  const [pcountry, setPCountry] = useState('');
  const [cAddress, setCAddress] = useState('');
  const [cCity, setCCity] = useState('');
  const [cState, setCState] = useState('');
  const [cPincode, setCPincode] = useState('');
  const [cCountry, setCCountry] = useState('');
  const [aadharNumber, setAAdharNumber] = useState('');
  const [aadharFile, setAadharFile] = useState('');
  const [pancardNumber, setPancardNumber] = useState('');
  const [pancardFile, setPancardFile] = useState('');
  const [uanNumber, setUanNumber] = useState('');
  const [bankName, setBankName] = useState('');
  const [accountNumber, setAccountNumber] = useState('');
  const [ifscCode, setIfscCode] = useState('');
  const [offerDate, setOffer] = useState('');
  const [joining, setJoining] = useState('');
  const [LastWorking, setLastWorking] = useState('');
  const [employeeSalaryId, setEmployeeSalaryId] = useState('');
  const [employeeType, setEmployeeType] = useState('');
  const [effectiveDay, setEffectiveDay] = useState('');
  const [salary, setSalary] = useState('');
  const [basicSalary, setBasicSalary] = useState('');
  const [hraAmount, setHraAmount] = useState('');
  const [specialAllowance, setSpecialAllowance] = useState('');
  const [createdBy, setCreatedBy] = useState('');

  const [formData, setFormData] = useState({
    userId: '',
    adminId: '',
    name: '',
    fatherName: '',
    department: '',
    designation: '',
    profile: '',
    dob: '',
    gender: '',
    qualification: '',
    contactNumber: '',
    WhatsappNumber: '',
    alternateNumber: '',
    officeEmail: '',
    personalEmail: '',
    marital: '',
    blood: '',
    pAdddres: '',
    pCity: '',
    pState: '',
    pPincode: '',
    pcountry: '',
    cAddress: '',
    cCity: '',
    cState: '',
    cPincode: '',
    cCountry: '',
    aadharNumber: '',
    aadharFile: '',
    pancardNumber: '',
    pancardFile: '',
    uanNumber: '',
    bankName: '',
    accountNumber: '',
    ifscCode: '',
    offerDate: '',
    joining: '',
    LastWorking: '',
    employeeSalaryId: '',
    employeeType: '',
    effectiveDay: '',
    salary: '',
    basicSalary: '',
    hraAmount: '',
    specialAllowance: '',
    createdBy: '',
  });
  function setData() {
    setName(data1);
    setOfficeEmail(data2);
  }







  // const sendData = async (userId, adminId, name, fatherName, department, designation, profile, dob, gender, qualification, contactNumber, WhatsappNumber, alternateNumber, officeEmail, personalEmail, marital, blood, pAdddres, pCity, pState, pPincode, pcountry, cAddress, cCity, cState, cPincode, cCountry, aadharNumber, aadharFile, pancardNumber, pancardFile, uanNumber, bankName, accountNumber, ifscCode, offerDate, joining, LastWorking, employeeSalaryId, employeeType, effectiveDay, salary, basicSalary, hraAmount, specialAllowance, createdBy) => {
  //   try {
  //     
  //     const response = await axios.post('http://localhost:8000/api/store-admin-data', {
  //       userId: userId,
  //       adminId: adminId,
  //       name: name,
  //       fatherName: fatherName,
  //       department: department,
  //       designation: designation,
  //       profile: formData,
  //       dob: dob,
  //       gender: gender,
  //       qualification: qualification,
  //       contactNumber: contactNumber,
  //       WhatsappNumber: WhatsappNumber,
  //       alternateNumber: alternateNumber,
  //       officeEmail: officeEmail,
  //       personalEmail: personalEmail,
  //       marital: marital,
  //       blood: blood,
  //       pAdddres: pAdddres,
  //       pCity: pCity,
  //       pState: pState,
  //       pPincode: pPincode,
  //       pcountry: pcountry,
  //       cAddress: cAddress,
  //       cCity: cCity,
  //       cState: cState,
  //       cPincode: cPincode,
  //       cCountry: cCountry,
  //       aadharNumber: aadharNumber,
  //       aadharFile: aadharFile,
  //       pancardNumber: pancardNumber,
  //       pancardFile: pancardFile,
  //       uanNumber: uanNumber,
  //       bankName: bankName,
  //       accountNumber: accountNumber,
  //       ifscCode: ifscCode,
  //       offerDate: offerDate,
  //       joining: joining,
  //       LastWorking: LastWorking,
  //       employeeSalaryId: employeeSalaryId,
  //       employeeType: employeeType,
  //       effectiveDay: effectiveDay,
  //       salary: salary,
  //       basicSalary: basicSalary,
  //       hraAmount: hraAmount,
  //       specialAllowance: specialAllowance,
  //       createdBy: createdBy,
  //     });
  //     console.log(response.data.message);
  //     if(response.data.message===true){
  //     alert('New Admin is registered... ')     
  //     }
  //     else{
  //       alert(response.data.message)
  //     }
  //   }
  //    catch (error) {
  //     console.error(error);
  //     alert('Please check')
  //   }
  // }
  const handleImageChange = (e) => {
    setprofile(e.target.files[0]);
  };
  const handleAadharChange = (e) => {
    setAadharFile(e.target.files[0]);
  };
  const handlePancardChange = (e) => {
    setPancardFile(e.target.files[0]);
  };
  //handleSubmit function
  const handleSubmit = (event) => {
    event.preventDefault();
    setData();
    setFormData([ ...formData, {userId, adminId, name, fatherName, department, designation, profile, dob, gender, qualification, contactNumber, WhatsappNumber, alternateNumber, officeEmail, personalEmail, marital, blood, pAdddres, pCity, pState, pPincode, pcountry, cAddress, cCity, cState, cPincode, cCountry, aadharNumber, aadharFile, pancardNumber, pancardFile, uanNumber, bankName, accountNumber, ifscCode, offerDate, joining, LastWorking, employeeSalaryId, employeeType, effectiveDay, salary, basicSalary, hraAmount, specialAllowance, createdBy }]);
    axios.post('http://localhost:8000/api/store-admin-data', formData)
      .then((response) => {
        console.log(response.data);
        // Handle success
      })
      .catch((error) => {
        console.error(error.response.data);
        // Handle error
      });
    // const formData = new FormData();
    // 
    // sendData(userId, adminId, name, fatherName, department, designation, profile, dob, gender, qualification, contactNumber, WhatsappNumber, alternateNumber, officeEmail, personalEmail, marital, blood, pAdddres, pCity, pState, pPincode, pcountry, cAddress, cCity, cState, cPincode, cCountry, aadharNumber, aadharFile, pancardNumber, pancardFile, uanNumber, bankName, accountNumber, ifscCode, offerDate, joining, LastWorking, employeeSalaryId, employeeType, effectiveDay, salary, basicSalary, hraAmount, specialAllowance, createdBy);
  };

  return (
    <div id='main'>
      <Sidebar />
      <div id='employee'>
        <h4>Add New Admin</h4>
        <form >
          <div className='detail'>
            <div className='detail1'>
              <div>User Id : </div>
              <div>Admin ID : </div>
              <div>Name : </div>
              <div>Father Name : </div>
              <div>Department : </div>
              <div>Designation : </div>
              <div>Profile Picture : </div>
              <div>Date of Birth : </div>
              <div>Gender : </div>
              <div>Qualification : </div>
              <div>Contact Number : </div>
              <div>Whatsapp Number : </div>
              <div>Alternate Number : </div>
              <div>Office Email : </div>
              <div>Personal Email : </div>
              <div>Marital Status : </div>
              <div>Blood group : </div>
              <div>Permanent Address : </div>
              <div>City : </div>
              <div>State : </div>
              <div>Pincode: </div>
              <div>Country : </div>
              <div>Current Address : </div>
              <div>Current City : </div>
              <div>Current State : </div>
              <div>Current Pincode: </div>
              <div>Current Country : </div>
              <div>Aadhar Card Number : </div>
              <div>Aadhar Card file : </div>
              <div>Pancard Id : </div>
              <div>Pancard file : </div>
              <div>UAN Number : </div>
              <div>Name of Bank : </div>
              <div>Bank account Number : </div>
              <div>IFSC Code : </div>
              <div>Offer Date : </div>
              <div>Joining Date : </div>
              <div>Last Working Date : </div>
              <div>Employee Salary Id : </div>
              <div>Employee Type : </div>
              <div>Effective Day : </div>
              <div>Salary : </div>
              <div>Basic Salary : </div>
              <div>HRA Amount : </div>
              <div>Special Allowance :</div>
              <div>Created By : </div>
            </div>
            <div className='detail2'>
              <input type='text' name='user_id' onChange={(event) => setUserId(event.target.value)}></input>
              <input type='text' name='id' onChange={(event) => setAdminId(event.target.value)}></input>
              <input type='text' name='name' value={data1}  ></input>
              <input type='text' name='fathers_name' onChange={(event) => setFathersName(event.target.value)}></input>
              <select name='department' onChange={(event) => setDepartment(event.target.value)}>
                <option value='01'>01 - Admin</option>
                <option value='02'>02 - Content Department</option>
                <option value='03'>03 - Customer Support Department</option>
                <option value='04'>04 - Designer Department</option>
                <option value='05'>05 - SEO Department</option>
                <option value='06'>06 - Social Media Department</option>
                <option value='07'>07 - Software Development Department</option>
              </select>
              <select name='designation' onChange={(event) => setDesignation(event.target.value)}>
                <option value="director ceo">Director / CEO</option>
                <option value="director md" selected>Director / MD</option>
                <option value="hr">HR</option>
                <option value="hr manager">HR Manager</option>
                <option value="cto">CTO</option>
                <option value="technical lead">Technical Lead</option>
                <option value="content writer">Content Writer</option>
                <option value="designer">Designer</option>
                <option value="sr designer">Sr Designer</option>
                <option value="seo executive">SEO Executive</option>
                <option value="sr seo executive">Sr SEO Executive</option>
                <option value="front-end developer">Front-End Developer</option>
                <option value="developer">Developer</option>
                <option value="customer care executive">Customer Care Executive</option>
                <option value="sr customer care executive">Sr Customer Care Executive</option>
              </select>
              <input type="file" onChange={handleImageChange} name='profile_picture' accept="image/png, image/jpeg" multiple></input>
              <input type="date" name='birth_date' onChange={(event) => setDob(event.target.value)}></input>
              <select name='gender' onChange={(event) => setGender(event.target.value)}>
                <option value="">Select</option>
                <option value="male">Male</option>
                <option value="female">Female</option>
              </select>
              <input type='text' name='qualification' onChange={(event) => setQualification(event.target.value)}></input>
              <input type='number' name='c_no' onChange={(event) => setContactNumber(event.target.value)}></input>
              <input type='number' name='w_no' onChange={(event) => setWhatsappNumber(event.target.value)}></input>
              <input type='number' name='a_no' onChange={(event) => setAlternateNumber(event.target.value)}></input>
              <input type='email' name='o_email' value={data2} ></input>
              <input type='email' name='p_email' onChange={(event) => setPersonalEmail(event.target.value)}></input>
              <select name='martial_status' onChange={(event) => setMarital(event.target.value)}>
                <option value="">Select</option>
                <option value="single">Single</option>
                <option value="married">Married</option>
              </select>
              <select name='blood_group' onChange={(event) => setBlood(event.target.value)}>
                <option value="">Select</option>
                <option value="A+">A+</option>
                <option value="A-">A-</option>
                <option value="B+">B+</option>
                <option value="B-">B-</option>
                <option value="O+">O+</option>
                <option value="O-">O-</option>
                <option value="AB+">AB+</option>
                <option value="AB-">AB-</option>
              </select>
              <input type='text' name='p_address' onChange={(event) => setPAddress(event.target.value)}></input>
              <input type='text' name='p_city' onChange={(event) => setPCity(event.target.value)}></input>
              <input type='text' name='p_state' onChange={(event) => setPState(event.target.value)}></input>
              <input type='number' name='p_pincode' onChange={(event) => setPPincode(event.target.value)}></input>
              <input type='text' name='p_country' onChange={(event) => setPCountry(event.target.value)}></input>
              <input type='text' name='c_address' onChange={(event) => setCAddress(event.target.value)}></input>
              <input type='text' name='c_city' onChange={(event) => setCCity(event.target.value)}></input>
              <input type='text' name='c_state' onChange={(event) => setCState(event.target.value)}></input>
              <input type='number' name='c_pincode' onChange={(event) => setCPincode(event.target.value)}></input>
              <input type='text' name='c_country' onChange={(event) => setCCountry(event.target.value)}></input>
              <input type='number' name='aadhar_no' onChange={(event) => setAAdharNumber(event.target.value)}></input>
              <input type="file" name='aadhar_file' accept='' onChange={handleAadharChange}></input>
              <input type='text' name='pancard_no' onChange={(event) => setPancardNumber(event.target.value)}></input>
              <input type="file" name='pancard_file' accept='' onChange={handlePancardChange}></input>
              <input type='number' name='uan_no' onChange={(event) => setUanNumber(event.target.value)}></input>
              <input type='text' name='bank_name' onChange={(event) => setBankName(event.target.value)}></input>
              <input type='number' name='bank_account_no' onChange={(event) => setAccountNumber(event.target.value)}></input>
              <input type='text' name='bank_ifsc_code' onChange={(event) => setIfscCode(event.target.value)}></input>
              <input type='date' name='offer_date' onChange={(event) => setOffer(event.target.value)}></input>
              <input type='date' name='joining_date' onChange={(event) => setJoining(event.target.value)}></input>
              <input type='date' name='last_working_date' onChange={(event) => setLastWorking(event.target.value)}></input>
              <input type='text' name='es_id' onChange={(event) => setEmployeeSalaryId(event.target.value)}></input>
              <select name='emp_type' onChange={(event) => setEmployeeType(event.target.value)}>
                <option value='ESI'>ESI</option>
                <option value='PF'>PF</option>
                <option value='ESI + PF'>ESI + PF</option>
                <option value='Others'>Others</option>
              </select>
              <input type='date' name='effective_day' onChange={(event) => setEffectiveDay(event.target.value)}></input>
              <input type='number' name='salary' onChange={(event) => setSalary(event.target.value)}></input>
              <input type='number' name='basic' onChange={(event) => setBasicSalary(event.target.value)}></input>
              <input type='number' name='hra' onChange={(event) => setHraAmount(event.target.value)}></input>
              <input type='number' name='special_allowance' onChange={(event) => setSpecialAllowance(event.target.value)}></input>
              <input type='text' name='createdBy' onChange={(event) => setCreatedBy(event.target.value)}></input>
            </div>
          </div>
          <div className='button'>
            <button type='submit' onClick={handleSubmit} name='submit'>Submit</button>
            <button type='reset'>Reset</button>
          </div>
        </form>
      </div>
      <Buttons />
    </div>
  )
}
export default AddAdmin
